function renameKey(obj, oldKey, newKey) {
    obj[newKey] = obj[oldKey];
    delete obj[oldKey];
}

function getChartInterval(age_entry) {
    //Age 50 – 60 -> 2 years interval
    //Age 1 – 49 -> 5 years interval
    //Note: x axis shall not exceed 25 bars
    if (age_entry >= 50)
        return 2;
    else
        return 3;
}

function getOverallGcpDeclaredUpToDateFormula(year, type, amount) {
    var amt = parseInt(amount);
    var data = [];
    var one, two, three, four, five;

    switch (type)
    {
        case 'mass':
            if (this.year == 5) {
                one = 0.05;
                two = 0.10;
                three = 0.10;
                four = 0.15;
                five = 0.15;
            }
            else if (this.year == 8) {
                one = 0.08;
                two = 0.16;
                three = 0.16;
                four = 0.24;
                five = 0.24;
            }
            else {
                one = 0.10;
                two = 0.10;
                three = 0.20;
                four = 0.20;
                five = 0.30;
            }
            break;
        case 'premier':
            if (this.year == 5) {
                one = 0.07;
                two = 0.12;
                three = 0.12;
                four = 0.17;
                five = 0.17;
            }
            else if (this.year == 8) {
                one = 0.11;
                two = 0.19;
                three = 0.19;
                four = 0.27;
                five = 0.27;
            }
            else {
                one = 0.12;
                two = 0.12;
                three = 0.22;
                four = 0.22;
                five = 0.32;
            }
            break;
        default:
            break;
    }

    for (var i = 1; i <= 100; i++) {
        if (i >= 1 && i <= 5) {
            data.push({
                'Year': i,
                'data': one * amt
            });
        } else if (i >= 6 && i <= 10) {
            data.push({
                'Year': i,
                'data': two * amt
            });
        } else if (i >= 11 && i <= 15) {
            data.push({
                'Year': i,
                'data': three * amt
            });
        } else if (i >= 16 && i <= 20) {
            data.push({
                'Year': i,
                'data': four * amt
            });
        } else {
            data.push({
                'Year': i,
                'data': five * amt
            });
        }
    }
    return data;
}

function getDeathPayout(overallgcpdeclareduptodateaccumulated, age_diff) {

    this.total_premium_paid = this.isMassPremier == 'mass' ? this.total_premium_paid_5 : this.total_premium_paid_premier_5;
    if (this.year == 8) {
        this.total_premium_paid = this.isMassPremier == 'mass' ? this.total_premium_paid_8 : this.total_premium_paid_premier_8;
    } else if (this.year == 10) {
        this.total_premium_paid = this.isMassPremier == 'mass' ? this.total_premium_paid_10 : this.total_premium_paid_premier_10;
    }
    if (this.selectedAmt == "1") 
        this.total_premium_paid = this.total_premium_paid.map(y => parseInt(y.one))
    else if (this.selectedAmt == "2")
        this.total_premium_paid = this.total_premium_paid.map(y => parseInt(y.two))
    else
        this.total_premium_paid = this.total_premium_paid.map(y => parseInt(y.three))

    var amt = parseInt(removeComma(this.amount));
    var deathPayout = [];

    for (var j = 1; j <= age_diff; j++) {
        if (j == 1) {
            //total premium paid - overallgcpdeclareduptodateaccumulated
            deathPayout.push(this.total_premium_paid[0] - overallgcpdeclareduptodateaccumulated[0]);
        }
        else if (j == 2) {
            //total premium paid - overallgcpdeclareduptodateaccumulated
            deathPayout.push(this.total_premium_paid[1] - overallgcpdeclareduptodateaccumulated[1]);

        } else {
            //(1.05 - total premium paid) - overallgcpdeclareduptodateaccumulated
            var deathpayout = (1.05 * this.total_premium_paid[j - 1]) - overallgcpdeclareduptodateaccumulated[j - 1]
            deathPayout.push(deathpayout < amt ? amt : deathpayout);
        }
    }

    return deathPayout;
}

function getAccumulatedGcp(overallgcpdeclareduptodate, age_diff) {
    var accumulatedgcp = [];
    this.accumulatedgcpwithdecimals = [];
    accumulatedgcp.push(overallgcpdeclareduptodate[0].data);
    this.accumulatedgcpwithdecimals.push(overallgcpdeclareduptodate[0].data);
    var previousdecimal = overallgcpdeclareduptodate[0].data;
    for (var j = 1; j < age_diff; j++) {
        accumulatedgcp.push(Math.round(overallgcpdeclareduptodate[j].data + (previousdecimal * 1.03)));
        previousdecimal = overallgcpdeclareduptodate[j].data + (previousdecimal * 1.03);
        this.accumulatedgcpwithdecimals.push(previousdecimal);
    }
    return accumulatedgcp;
}

function getAccumulatedInterest(accumulatedgcp, cumulativeGcpWOInterest) {
    var accumulated_interest = [];
    var ind = 0;
    this.accumulatedgcpwithdecimals_interest = [];
    accumulatedgcp.forEach(y => {
        accumulated_interest.push(accumulatedgcp[ind] - cumulativeGcpWOInterest[ind]);
        this.accumulatedgcpwithdecimals_interest.push(this.accumulatedgcpwithdecimals[ind] - cumulativeGcpWOInterest[ind]);
        ind++;
    });
    return accumulated_interest;
}

