// for testing purposes
var hideRefereneTable = true;
function displayReferenceTable(title1, data1, title2, data2, title3, data3) {
    if (this.hideRefereneTable == true)
        return;

    $('.reference_table').removeClass('hide');
    $('.reference_data').html(``);
    $('.reference_header').html(``);

    if (data3 != null && data3.length != 0) {
        var html = "";
        var index = 0;
        data3.forEach(y => {
            html = html + `<tr><td>${data1[index]}</td><td>${data2[index]}</td><td>${y}</td></tr>`;
            index++;
        })
        $('.reference_data').append(`${html}`);
        $('.reference_header').append(`<th>${title1}</th>`);
        $('.reference_header').append(`<th>${title2}</th>`);
        $('.reference_header').append(`<th>${title3}</th>`);
        return;
    } else if (data2 != null && data2.length != 0) {
        var html = "";
        var index = 0;
        data2.forEach(y => {
            html = html + `<tr><td>${data1[index]}</td><td>${y}</td></tr>`;
            index++;
        })
        $('.reference_data').append(`${html}`);
        $('.reference_header').append(`<th>${title1}</th>`);
        $('.reference_header').append(`<th>${title2}</th>`);
        return;
    }

    var html = "";
    data1.forEach(y => {
        html = html + `<tr><td>${y}</td></tr>`;
    })
    $('.reference_data').html(`${html}`);
    $('.reference_header').html(`<th>${title1}</th>`);
}